8\u0435\">\u0441\u043a\u0430\u0443\u0442\u0441\u043a\u0438\u043c<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913_%D0%B3%D0%BE%D0%B4\" title=\"1913 \u0433\u043e\u0434\">1913<\/a>&#160;\u2014 \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438<\/a> \u0441\u0442\u0430\u043b \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B1%D0%B5%D1%80%D1%80%D0%B0\" title=\"\u041a\u0430\u043d\u0431\u0435\u0440\u0440\u0430\">\u041a\u0430\u043d\u0431\u0435\u0440\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D0%B2%D1%80%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0435\u0432\u0440\u0430\u043b\u044c\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u0424\u0435\u0432\u0440\u0430\u043b\u044c\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>: \u0421\u043e\u0432\u0435\u0442\u043e\u043c \u0441\u0442\u0430\u0440\u0435\u0439\u0448\u0438\u043d 4-\u0439 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0434\u0443\u043c\u044b \u043f\u043e \u043f\u043e\u0440\u0443\u0447\u0435\u043d\u0438\u044e \u0447\u0430\u0441\u0442\u043d\u043e\u0433\u043e \u0441\u043e\u0432\u0435\u0449\u0430\u043d\u0438\u044f \u0435\u0451 \u0447\u043b\u0435\u043d\u043e\u0432 \u0431\u044b\u043b \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d \u0412\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0439 \u043a\u043e\u043c\u0438\u0442\u0435\u0442 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0434\u0443\u043c\u044b, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u0438\u043b \u0420\u043e\u0434\u0437\u044f\u043d\u043a\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a><ul><li>\u041e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u043e \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u0435 \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u041c\u043e\u0441\u043a\u0432\u0430 \u0441\u0442\u0430\u043b\u0430 \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439 (\u0434\u043d\u0451\u043c \u0440\u0430\u043d\u0435\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0435\u0440\u0435\u0435\u0437\u0434 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430).<\/li><li>\u041d\u0430\u0447\u0430\u043b\u0441\u044f \u043f\u0435\u0440\u0435\u0445\u043e\u0434 \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u0439 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D0%BB%D0%BE%D1%82_%D0%92%D0%9C%D0%A4_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442 \u0412\u041c\u0424 \u0420\u043e\u0441\u0441\u0438\u0438\">\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430<\/a> \u0438\u0437 \u0413\u0435\u043b\u044c\u0441\u0438\u043d\u0433\u0444\u043e\u0440\u0441\u0430 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B5%D0%BB%D1%8C%D1%81%D0%B8%D0%BD%D0%BA%D0%B8\" title=\"\u0425\u0435\u043b\u044c\u0441\u0438\u043d\u043a\u0438\">\u0425\u0435\u043b\u044c\u0441\u0438\u043d\u043a\u0438<\/a>) \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%BE%D0%BD%D1%88%D1%82%D0%B0%D0%B4%D1%82\" title=\"\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\">\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442<\/a>. \u0412\u043e\u0448\u0451\u043b \u0432 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0443\u044e \u0438\u0441\u0442\u043e\u0440\u0438\u044e \u043a\u0430\u043a \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B4%D0%BE%D0%B2%D1%8B%D0%B9_%D0%BF%D0%BE%D1%85%D0%BE%D0%B4_%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%84%D0%BB%D0%BE%D1%82%D0%B0\" title=\"\u041b\u0435\u0434\u043e\u0432\u044b\u0439 \u043f\u043e\u0445\u043e\u0434 \u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430\">\u041b\u0435\u0434\u043e\u0432\u044b\u0439 \u043f\u043e\u0445\u043e\u0434<\/a>\u00bb.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D1%83%D0%B7%D0%B8%D1%8F\" title=\"\u0413\u0440\u0443\u0437\u0438\u044f\">\u0413\u0440\u0443\u0437\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%BC%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0410\u0440\u043c\u0435\u043d\u0438\u044f\">\u0410\u0440\u043c\u0435\u043d\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD\" title=\"\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\">\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d<\/a> \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BA%D0%B0%D0%B2%D0%BA%D0%B0%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0